VALUES (nextval('COURSE_SEQ'), 'Dans', 'Deze dansles is speciaal voor mensen met een verstandelijke beperking. Ze leren verschillende dansen, losse dansen met eenvoudige bewegingen, party dance, maar ook stijldansen zoals Quickstep, Engelse wals, ChaChaCha en Tango. \nBij deze groep is het vooral belangrijk dat ze zich even lekker kunnen bewegen en uiten en dat ze andere mensen ontmoeten. Ervaring leert dat ze het als heel erg leuk ervaren en dit met heel veel plezier doen.
\nNatuurlijk is het niet zomaar iets doen, maar zit er ook een doel achter. Ze zijn namelijk bezig met bewegen op muziek en dat is goed voor de motorische ontwikkeling, sociale ontwikkeling en lichamelijke ontwikkeling. Het plezier dat wordt beleefd door te leren dansen is uiteraard weer goed voor hun zelfvertrouwen.
De dansen zijn zo gemaakt dat iedere cursist op zijn eigen manier kan meedoen. Er wordt rekening gehouden met de beperkingen van de cursisten en ze worden gestimuleerd steeds een beetje meer te kunnen. Ze worden bij ons niet geconfronteerd met hun niet kunnen maar juist met wat ze WEL kunnen. Dit stimuleert ze en geeft ze zelfvertrouwen!',
        'Ze leren verschillende dansen, losse dansen met eenvoudige bewegingen, party dance, maar ook stijldansen zoals Quickstep, Engelse wals, ChaChaCha en Tango. ',
        'Mechelen', 'dans',false);
